import React from 'react';
import './BobaRanking.css';

const BobaRanking = ({ bobaPlaces, handleRankChange }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Rank</th>
          <th>Name</th>
          <th>Location</th>
          <th>Rating</th>
          <th>Type</th>
        </tr>
      </thead>
      <tbody>
        {bobaPlaces.map((bobaPlace) => (
          <tr key={bobaPlace.rank}>
            <td>{bobaPlace.rank}</td>
            <td>{bobaPlace.name}</td>
            <td>{bobaPlace.location}</td>
            <td>{bobaPlace.rating}</td>
            <td>{bobaPlace.type}</td>
            <td>
              <button onClick={() => handleRankChange(bobaPlace.rank - 1, bobaPlace.rank)}>
                &#8593;
              </button>
              <button onClick={() => handleRankChange(bobaPlace.rank + 1, bobaPlace.rank)}>
                &#8595;
              </button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default BobaRanking;
